import React, { useState, useEffect } from 'react';
import axios from 'axios';
import '../Style.T/AdminDashboard.css';

const AdminPage = () => {
  const [appointments, setAppointments] = useState([]);
  const [inventory, setInventory] = useState([]);
  const [newCar, setNewCar] = useState({
    name: '',
    price: '',
    odometer: '',
    odometerUnit: 'km',
    fuelType: '',
    image: '',
    make: '',
    model: '',
    year: '',
    bodyStyle: '',
    color: '',
    transmission: '',
    engine: '',
    passengers: '',
    description: '',
  });
  const [editCar, setEditCar] = useState(null);

  useEffect(() => {
    fetchAppointments();
    fetchInventory();
  }, []);

  const fetchAppointments = async () => {
    try {
      const response = await axios.get('http://localhost:8081/api/appointments');
      setAppointments(response.data);
    } catch (error) {
      console.error('Error fetching appointments:', error);
    }
  };

  const fetchInventory = async () => {
    try {
      const response = await axios.get('http://localhost:8081/api/inventory');
      setInventory(response.data);
    } catch (error) {
      console.error('Error fetching inventory:', error);
    }
  };

  const handleAddCar = async () => {
    try {
      await axios.post('http://localhost:8081/api/inventory', newCar);
      alert('Car added successfully!');
      setNewCar({
        name: '',
        price: '',
        odometer: '',
        odometerUnit: 'km',
        fuelType: '',
        image: '',
        make: '',
        model: '',
        year: '',
        bodyStyle: '',
        color: '',
        transmission: '',
        engine: '',
        passengers: '',
        description: '',
      });
      fetchInventory();
    } catch (error) {
      console.error('Error adding car:', error);
    }
  };

  const handleEditCar = async (car) => {
    try {
      await axios.put(`http://localhost:8081/api/inventory/${car.id}`, editCar);
      alert('Car updated successfully!');
      setEditCar(null);
      fetchInventory();
    } catch (error) {
      console.error('Error updating car:', error);
    }
  };

  const handleDeleteCar = async (carId) => {
    try {
      await axios.delete(`http://localhost:8081/api/inventory/${carId}`);
      alert('Car deleted successfully!');
      fetchInventory();
    } catch (error) {
      console.error('Error deleting car:', error);
    }
  };

  return (
    <div className="admin-dashboard">
      <h1>Admin Dashboard</h1>
      <div className="dashboard-sections">
        {/* Appointments Section */}
        <div className="appointments-section">
          <h2>Appointment History</h2>
          {appointments.length === 0 ? (
            <p>No appointments available</p>
          ) : (
            <table className="appointments-table">
              <thead>
                <tr>
                  <th>ID</th>
                  <th>Customer Name</th>
                  <th>Contact</th>
                  <th>Vehicle</th>
                  <th>Date</th>
                </tr>
              </thead>
              <tbody>
                {appointments.map((appointment) => (
                  <tr key={appointment.id}>
                    <td>{appointment.id}</td>
                    <td>{appointment.customerName}</td>
                    <td>{appointment.contact}</td>
                    <td>{appointment.vehicle}</td>
                    <td>{appointment.date}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          )}
        </div>

        {/* Inventory Management Section */}
        <div className="inventory-section">
          <h2>Inventory Management</h2>
          {/* Add Car Form */}
          <div className="add-car-form">
            <h3>Add New Car</h3>
            <input
              type="text"
              placeholder="Car Name"
              value={newCar.name}
              onChange={(e) => setNewCar({ ...newCar, name: e.target.value })}
            />
            <input
              type="number"
              placeholder="Price"
              value={newCar.price}
              onChange={(e) => setNewCar({ ...newCar, price: e.target.value })}
            />
            <input
              type="number"
              placeholder="Odometer"
              value={newCar.odometer}
              onChange={(e) => setNewCar({ ...newCar, odometer: e.target.value })}
            />
            <select
              value={newCar.odometerUnit}
              onChange={(e) => setNewCar({ ...newCar, odometerUnit: e.target.value })}
            >
              <option value="km">km</option>
              <option value="miles">miles</option>
            </select>
            <input
              type="text"
              placeholder="Fuel Type"
              value={newCar.fuelType}
              onChange={(e) => setNewCar({ ...newCar, fuelType: e.target.value })}
            />
            <input
              type="text"
              placeholder="Image URL"
              value={newCar.image}
              onChange={(e) => setNewCar({ ...newCar, image: e.target.value })}
            />
            <button onClick={handleAddCar}>Add Car</button>
          </div>

          {/* Inventory Table */}
          <table className="inventory-table">
            <thead>
              <tr>
                <th>Name</th>
                <th>Price</th>
                <th>Odometer</th>
                <th>Fuel Type</th>
                <th>Actions</th>
              </tr>
            </thead>
            <tbody>
              {inventory.map((car) => (
                <tr key={car.id}>
                  <td>{car.name}</td>
                  <td>${car.price}</td>
                  <td>
                    {car.odometer} {car.odometerUnit}
                  </td>
                  <td>{car.fuelType}</td>
                  <td>
                    <button onClick={() => setEditCar(car)}>Edit</button>
                    <button onClick={() => handleDeleteCar(car.id)}>Delete</button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>

          {/* Edit Car Form */}
          {editCar && (
            <div className="edit-car-form">
              <h3>Edit Car</h3>
              <input
                type="text"
                placeholder="Car Name"
                value={editCar.name}
                onChange={(e) => setEditCar({ ...editCar, name: e.target.value })}
              />
              <input
                type="number"
                placeholder="Price"
                value={editCar.price}
                onChange={(e) => setEditCar({ ...editCar, price: e.target.value })}
              />
              <input
                type="number"
                placeholder="Odometer"
                value={editCar.odometer}
                onChange={(e) => setEditCar({ ...editCar, odometer: e.target.value })}
              />
              <button onClick={() => handleEditCar(editCar)}>Save Changes</button>
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default AdminPage;
